INSERT INTO `questiondtl` VALUES (1,'<div class=\"col-12\">In the past two (2) weeks did you experience any of these Respiratory Symptoms?</div><div class=\"col-12\" style=\"padding-left: 25px;\">A. Cough <br>B. Shortness of breath <br>C. Colds <br>D. Throat pain <br>E. Other respiratory symptoms <br>F. Influenza-like symptoms (headache, muscle and joint pains, diarrhea, lack of smell or taste)</div>',1,1,'DRP_DWN',2,0),(2,'<div class=\"col-12\">In the past two (2) weeks did you experience any Fever with a temperature of 38&deg;C or more?</div>',1,1,'DRP_DWN',4,0),(3,'<div class=\"col-12\">Do you have a history of COVID-19 infection?</div>',1,1,'DRP_DWN',5,0),(4,'<div class=\"col-12\">Are there any member of your household that diagnosed with COVID-19?</div>',1,1,'DRP_DWN',6,0),(5,'<div class=\"col-12\">In the past two (2) weeks did you travel in any area that has a report of local transmission of COVID-19?</div>',1,1,'DRP_DWN',7,0),(6,'<div class=\"col-12\">Did you have any contact or exposure to someone with recent travel to an area with local transmission of COVID-19?</div>',1,1,'DRP_DWN',8,0),(7,'<div class=\"col-12\">Date of onset of symptoms stated previously?</div>',1,1,'DATE',3,0),(9,'<div class=\"col-12\">What is your working schedule today?</div>',1,1,'DRP_DWN',1,0),(10,'<div class=\"col-12\">Please enter your birthdate</div>',2,2,'DATE',1,0);
